    recipe_id: 648524,
    title: "Jean's Seafood Gumbo",
    summary:
      'If you want to add more <b>Cajun</b> recipes to your recipe box, Jean\'s Seafood Gumbo might be a recipe you should try. For <b>$5.32 per serving</b>, this recipe <b>covers 50%</b> of your daily requirements of vitamins and minerals. One serving contains <b>558 calories</b>, <b>72g of protein</b>, and <b>20g of fat</b>. This recipe serves 9. 6 people have tried and liked this recipe. Only a few people really liked this main course. It is a good option if you\'re following a <b>dairy free</b> diet. If you have canned tomatoes, creole seasoning, peppers, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 87%</b>, which is great. <a href="https://spoonacular.com/recipes/seafood-gumbo-411231">Seafood Gumbo</a>, <a href="https://spoonacular.com/recipes/seafood-gumbo-34779">Seafood Gumbo</a>, and <a href="https://spoonacular.com/recipes/seafood-gumbo-971756">Seafood Gumbo</a> are very similar to this recipe.',
