    id: 686,
    recipe_id: 632299,
    title: 'Amazing Braised Beef Short Ribs',
    summary:
      'If you have approximately <b>about 45 minutes</b> to spend in the kitchen, Amazing Braised Beef Short Ribs might be a tremendous <b>gluten free and dairy free</b> recipe to try. This recipe serves 6. One serving contains <b>788 calories</b>, <b>60g of protein</b>, and <b>48g of fat</b>. For <b>$6.36 per serving</b>, this recipe <b>covers 37%</b> of your daily requirements of vitamins and minerals. 6 people were impressed by this recipe. This recipe from Foodista requires bacon, carrot, ground pepper, and beef stock. It works well as a main course. Overall, this recipe earns a <b>good spoonacular score of 72%</b>. If you like this recipe, you might also like recipes such as <a href="https://spoonacular.com/recipes/braised-beef-short-ribs-245460">Braised Beef Short Ribs</a>, <a href="https://spoonacular.com/recipes/braised-beef-short-ribs-570525">Braised Beef Short Ribs</a>, and <a href="https://spoonacular.com/recipes/braised-beef-short-ribs-601461">Braised Beef Short Ribs</a>.',
    readyInMinutes: 45,
    servings: 6,
    image: 'https://spoonacular.com/recipeImages/632299-556x370.jpg',
    pricePerServing: 635.61,
    sourceName: 'Foodista',
    ingredients: [
      { name: 'bacon', original: '4 strips of Bacon' },
      { name: 'olive oil', original: '3 tablespoons Olive Oil' },
      { name: 'beef short ribs', original: '5 pounds Beef Short Ribs' },
      { name: 'sea salt', original: '1 teaspoon Sea Salt, fine grain' },
      { name: 'ground pepper', original: '1 teaspoon Fresh Ground Pepper' },
      { name: 'white button mushrooms', original: '1 pound White Button Mushrooms, sliced' },
      { name: 'yellow onions', original: '2 Medium Yellow Onions, diced' },
      { name: 'carrot', original: '1 Medium Carrot, diced' },
      { name: 'garlic', original: '4 cloves Large of Garlic, minced' },
      { name: 'cabernet sauvignon', original: '2 cups Cabernet Sauvignon Wine' },
      { name: 'beef stock', original: '2 cups Beef Stock' },
      { name: 'tomato paste', original: '2 tablespoons Tomato Paste' },
      { name: 'beef base', original: '2 tablespoons Beef Base' },
      { name: 'fresh thyme', original: '1 tablespoon Dried Thyme or 6 fresh Sprigs' },
      { name: 'bay leaves', original: '2 Bay leaves' },
      { name: 'ground pepper', original: '1 teaspoon Fresh Ground Black Pepper' },
    ],
    instructionSections: 1,
    instructions: [
      {
        name: '',
        steps: [
          'Preheat your oven to 300 degrees.',
          'Place a large heavy bottomed pot on the stove top (like a Le Creuset pot).',
          'Over medium heat cook 4 strips of Bacon in the large heavy bottomed pot until crisp.',
          'Remove from the heat and allow to drain on paper towels.  Later you will crumble the Bacon into the finished Sauce.  Reserve the Bacon Fat in the pot.',
          'Dry off any moisture on your Beef Short Ribs using paper towel.  The meat will brown better and caramelize instead of steam if it is dry.  This browning will produce a lot of flavor in the finished dish.',
          'Cut the Short Ribs into 3-4 inch sections.  Trim some of the excess outer fat, leaving some for flavor.  Season the Short Ribs with Sea Salt and Black Pepper.',
          'Over medium high add 3 T of Olive Oil to the Bacon Fat and brown all sides of the Short Ribs until they get a good dark brown sear.  Give the Short Ribs room between each other so they do not steam and brown properly.  You will have to do this in 2 to 3 batches to brown all the Short Ribs well.   You will not be cooking through all the way, just browning at this stage.  The Short Ribs will be raw in the middle.',
          'Place the first batch after browning in a bowl to catch any drippings.',
          'After all the Short Ribs are browned well, remove them from the pot and set aside in the large bowl to collect any drippings as they sit.  Next remove the used Bacon Fat and Olive Oil from the pot leaving any of the cooked on bits stuck to the bottom of the pot.  Reduce the heat to medium and add 3 T of fresh Olive Oil and saute the sliced Mushrooms until browned and crisp. 7-10 minutes.',
          'Then over medium heat add the diced Onions and Carrot and saute until soft, 5-7 minutes.',
          'Add the minced Garlic and cook for 1 minute more.',
          'Deglaze the pot by adding 2 cups of Cabernet Sauvignon.  As soon as you add the Wine increase the heat to high and stir rapidly, scraping the bottom of the pot releasing the cooked on brown bits stuck to the bottom.  Bring to the boil then add 2 cups of Beef Stock and the Tomato Paste, Beef Base, Thyme, Bay Leaves, Sea Salt and Black Pepper.  Allow to boil, stirring continuously for 3 minutes.',
          'Add the Beef Short Ribs and any juices that collected in the bowl to the boiling pot.',
          'Put them in snugly against each other and boil for 2 minutes.',
          "Then place the lid on the pot and place in the center of the oven and cook for 3 hours at 300 degrees undisturbed.  Don't peek and release the moist heat that will make these Short Ribs fall of the bone.",
          'After 3 hours remove from the oven and take off the lid.  Prepare for a steam facial!',
          'Remove the Cooked Beef Short Ribs to a large bowl.  Be gentle, it will be falling off the bone.  Allow the Sauce to sit for 3 minutes so the fat rises to the top.  Skim off the fat using a large spoon and discard it.',
          'Remove as much as you can.',
          'Remove the Bay Leaves and stems from the Thyme if you used fresh Thyme.',
          'Remember, the pot is HOT, it just came from the oven!!!  Use pot holders and place the pot of defatted Sauce over medium high heat and bring to a boil, stirring frequently, and reduce by a third.  This will concentrate the Sauce into a rich incredible Sauce. Taste the Sauce and add Sea Salt and or Black Pepper is needed at this point.  Crumble the Bacon and add to the Sauce stirring in well.',
          'Add the Beef Short Ribs back to the pot of reduced Sauce and remove from the heat.  Coat the Short Ribs in the Sauce well.',
          'Serve Immediately over Yukon Gold Mashed Potatoes or Polenta.',
        ],
      },
    ],
